(49, 'Silicon Case', 14, '100.000', '100.00', '150.00', 0, 0, 1, 107, 'siliconCase', 1, 0, 'siliconCase', 0, 'Generico Nuevo', '<p><span style=\"font-family: -apple-system;\">Silicon case generico</span></p><p>Mismos materiales que el original&nbsp;</p><p>Envió gratis en la compras mayores a Diez unidades</p><p>Pregunta por la disponibilidad de tu color y modelo</p>', '0.00'),
(50, 'Apple  Watch Series 3', 11, '100.000', '5500.00', '6000.00', 0, 0, 5, 110, 'watchs3gps', 0, 0, 'watchs3gps', 0, 'GPS SemiNuevo 42mm', '<p><span style=\"font-family: -apple-system;\">Silicon case generico</span></p><p>Mismos materiales que el original&nbsp;</p><p>Envió gratis en la compras mayores a Diez unidades</p><p>Pregunta por la disponibilidad de tu color y modelo</p>', '0.00'),
(51, ' Watch Series 4', 11, '100.000', '7000.00', '8000.00', 0, 0, 5, 115, 'apws440mm', 1, 1, 'apws440mm', 0, 'SemiNuevo 40mm LTE', '<h1>Apple  Watch Series 4 LTE<br></h1><h3><span style=\"text-align: left;\">Ideal para ti. Monitorea tu actividad física en todo momento y vive la experiencia Serie 4 de Apple.&nbsp;</span></h3><blockquote class=\"blockquote\">El Apple Watch Series 4 tiene la pantalla más grande usada en un Apple Watch hasta ahora, un novedoso sensor cardiaco eléctrico y respuesta háptica en la Digital Crown. Aunque te resultará familiar, el Apple Watch Series 4 es un reloj totalmente nuevo que revoluciona el mundo de los relojes inteligentes.</blockquote><blockquote class=\"blockquote\">Con las notificaciones de frecuencia cardiaca baja o alta, las funcionalidades Detección de Caídas y Emergencia SOS, y las nuevas carátulas Respirar, el Apple Watch Series 4 está diseñado para mejorar tu salud todos los días y ayudarte a protegerla.</blockquote><h3><span style=\"caret-color: rgb(51, 51, 51); color: rgb(51, 51, 51); font-family: &quot;Myriad Pro &quot;, sans-serif; font-size: 18px; white-space: pre-line; word-spacing: 2px;\"><br></span><span style=\"text-align: left;\"><br></span></h3><h3><span style=\"text-align: left;\"><br></span></h3>', '0.00'),
(52, 'AirPods 2 ', 11, '100.000', '3378.00', '3500.00', 0, 0, 5, 123, 'airpods2ea', 1, 1, 'airpods2ea', 0, 'Nuevos 2da Generacion', '<h2 class=\"pd-container-header\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; line-height: 1.14286;\">AirPods</h2><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; line-height: 1.14286;\">Segunda generacion&nbsp;</p><p><span style=\"text-align: center;\">Con estuche de carga</span></p><h2 class=\"typography-tagline-reduced large-9 large-centered medium-10 small-12\" style=\"margin: 0.175em auto 0px; padding: 0px; width: 735px; float: none; line-height: 1.08365;\">Más mágicos que&nbsp;nunca.</h2><p>Los AirPods te brindan una experiencia inalámbrica inigualable, pues ahora te ofrecen más horas para hablar, acceso a Siri activado por voz y un nuevo estuche de carga inalámbrica. Sácalos del estuche y estarán listos para funcionar con todos tus dispositivos. Póntelos y se conectarán al instante, como&nbsp;<br class=\"large-show small-hide medium-hide\" style=\"display: block;\">por arte de magia, para brindarte una experiencia sonora de&nbsp;gran&nbsp;calidad.<br></p><p>Nota al cliente:&nbsp;<span style=\"font-size: 1rem;\">Unidades limitadas pregunta antes por disponibilidad y sobre la entrega en tu zona.</span></p>', '0.00'),
(53, 'iPhone 8', 11, '100.000', '9500.00', '10500.00', 0, 0, 5, 126, 'iphone864gb', 1, 2, 'iphone864gb', NULL, 'Nuevo Libre 64gb', '<p><h1><span style=\"text-align: center;\">&nbsp;</span><span style=\"text-align: center;\">4.7”</span></h1><span class=\"badge-copy\" style=\"text-align: center;\">Retina HD display</span></p><p><span class=\"badge-copy\" style=\"text-align: center;\">Diseño de vidrio y aluminio</span><br></p><p><span style=\"text-align: center;\">Sistema de cámara única de 12&nbsp;MP: gran angular</span></p><p><span class=\"badge-value\" style=\"line-height: 1; left: -2px; display: block; position: relative; z-index: 1; margin-bottom: 2px;\">7 MP</span><span class=\"badge-copy\" style=\"text-align: center;\">Cámara FaceTime HD con grabación de video HD de 1080p a 30&nbsp;cps</span></p><p><span class=\"badge-copy\" style=\"text-align: center;\">Touch&nbsp;ID</span></p><p><span class=\"badge-copy\" style=\"text-align: center;\">Chip A11&nbsp;Bionic<br>con Neural&nbsp;Engine</span></p><p><span class=\"badge-copy\" style=\"text-align: center;\">Aproximadamente la misma duración de batería que el iPhone&nbsp;7</span></p><p><span class=\"badge-copy\" style=\"text-align: center;\">Resistente al agua hasta por 30 minutos a una profundidad máxima de 1&nbsp;metro<br><span style=\"caret-color: rgb(51, 51, 51); color: rgb(51, 51, 51); font-family: &quot;SF Pro Text&quot;, &quot;SF Pro Icons&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 17px; font-weight: 600; letter-spacing: -0.37400001287460327px;\"><br></span><span style=\"caret-color: rgb(51, 51, 51); color: rgb(51, 51, 51); font-family: &quot;SF Pro Text&quot;, &quot;SF Pro Icons&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 17px; font-weight: 600; letter-spacing: -0.37400001287460327px;\"><br></span><br></span><span style=\"text-align: center;\"><br></span><br></p>', '11500.00'),
(54, 'iPhone 11', 11, '100.000', '16500.00', '17500.00', 0, 0, 1, 129, 'iphone1164', 1, 1, 'iphone1164', 0, 'Nuevo Libre 64gb', '<p></p><p></p><p></p><h1><span class=\"badge-value\" style=\"line-height: 1; left: -2px; display: block; position: relative; z-index: 1; margin-bottom: 6px;\">6.1”</span></h1><span class=\"badge-copy\" style=\"text-align: center;\">Pantalla Liquid Retina&nbsp;HD</span><p></p><p><span style=\"text-align: center; font-size: 1rem;\">Diseño de vidrio y aluminio</span></p><p><span style=\"text-align: center;\">Sistema de dos cámaras de 12&nbsp;MP con modo Noche: ultra gran angular y gran&nbsp;angular</span></p><p></p><p></p><h1><span class=\"badge-value\" style=\"line-height: 1; left: -2px; display: block; position: relative; z-index: 1; margin-bottom: 6px;\">12&nbsp;MP</span></h1><span class=\"badge-copy\" style=\"text-align: center;\">Cámara TrueDepth con grabación de video 4K a un máximo de 60&nbsp;cps</span><span style=\"text-align: center;\"><br></span><h1><span style=\"text-align: center;\">Face&nbsp;ID</span></h1><h5><span style=\"text-align: center;\">Chip A13&nbsp;Bionic<br></span><span style=\"text-align: center;\">con Neural Engine<br></span><span style=\"text-align: center;\">de tercera generación</span></h5><h5><span style=\"text-align: center;\">Hasta 1 hora más de batería que el iPhone&nbsp;X</span><span class=\"small-caps\" style=\"text-align: center;\">R</span></h5><h5><span style=\"text-align: center;\">Resistente al agua hasta por 30 minutos a una profundidad máxima de 2&nbsp;metros</span></h5><h6><span class=\"small-caps\" style=\"text-align: center;\"><br></span></h6><span style=\"text-align: center;\">*Producto importado, el&nbsp;envío&nbsp;puede tardar un poco mas de lo habitual.</span><p></p><p></p><p></p>', '0.00'),
