(56, 'iPad 5 128gb', 11, '100.000', '7552.00', '8560.00', 0, 0, 5, 138, 'ipad5128', 1, 2, 'ipad5128', NULL, 'Nuevo 128gb', '<p>iPad 5 WI-FI 128 GB&nbsp;<br style=\"margin: 0px; outline: none;\">Chip A9 con arquitectura de 64 bits<br style=\"margin: 0px; outline: none;\">Sistema operativo iOS 10<br style=\"margin: 0px; outline: none;\">Hasta 10 horas de batería</p><p><span style=\"font-size: 1rem;\">Pantalla Multi-Touch de 9.7 pulgadas (diagonal) retroiluminada por LED con tecnología IPS&nbsp;</span></p><p>Resolución de 2048 x 1536 pixeles a 264 ppi&nbsp;<br style=\"margin: 0px; outline: none;\">Cámara de 8 MP&nbsp;<br style=\"margin: 0px; outline: none;\">Alto: 240 mm&nbsp;<br style=\"margin: 0px; outline: none;\">Ancho: 169.5 mm&nbsp;<br style=\"margin: 0px; outline: none;\">Grosor: 7.5 mm&nbsp;<br style=\"margin: 0px; outline: none;\">Peso: 469 g&nbsp;<br></p>', '10000.00'),
