INSERT INTO `configuraciones_generales` (`id`, `nombre`, `rfc`, `dir`, `tels`, `msj`, `mail`, `web`, `fb`, `inst`, `twtr`, `wtsp`, `mgn`, `icon_site`, `logo_empresa`, `sobre_nosotros_corto`, `mision`, `vision`, `sobre_nosotros_largo`, `terminos`, `cambio_dolar`) VALUES
(1, 'Micel.Store', 'LAYF960414VE6', 'Calle Lirios N1 Zacualtipán de Angeles Hidalgo', '7717944100', '¡Gracias por su compra!', 'ventas@micel.store', 'www.micel.store', 'https://www.facebook.com/micelstoremx', 'https://www.instagram.com/micelstore/', 'https://twitter.com/MicelStore', '7717944100', 'm.me/micelstoremx', 'icono', 'logo', 'Venta de  celulares nuevos y con garantía ⭐️ Envíos gratis a todo el país', 'Traerte los mejores equipos al mejor precio ', 'Ser el mejor distribuidor de telefonía móvil de la región', '¿Tienes dudas? Revisa nuestras preguntas frecuentes.', '<h1><span style=\"font-family: -apple-system;\">﻿</span>Términos y condiciones </h1>\r\n\r\n<p><em>Al utilizar nuestros servicios se entiende que usted acepta nuestros términos y condiciones</em></p>\r\n\r\n<h4 style=\"font-family: Poppins, sans-serif; color: rgb(34, 34, 34);\"><span style=\"font-family: Helvetica;\">CONDICIONES DE COMPRA</span><span style=\"font-family: Helvetica;\">﻿</span></h4>\r\n\r\n<ul>\r\n <li>El servicio se prestara en el horario de 10:00 am a 8:00 pm de lunes a viernes, y domingo de 12:00 pm a 5:00 pm. </li>\r\n <li>La compra únicamente podrá realizarse por personas que tengan <b>18 años de edad </b>cumplidos o mayores a esta.</li>\r\n<li><span style=\"font-size: 1rem;\">Para efectuar la compra el consumidor </span>deberá<span style=\"font-size: 1rem;\"> registrarse como usuario cliente con los datos correspondientes, en el cual se le </span>requerirán<span style=\"font-size: 1rem;\"> algunos datos personales, entre ellos un <b>correo </b></span><b>electrónico<span style=\"font-size: 1rem;\"> activo o numero de </span>teléfono</b><span style=\"font-size: 1rem;\"> para contactar al consumidor durante el proceso de compra.</span></li><li><span style=\"font-size: 1rem;\">Una vez realizada la compra, <b>no hay devoluciones</b>, cambios ni </span>reembolsos<span style=\"font-size: 1rem;\"> <b>por error del usuario.</b></span></li><ul>\r\n</ul></ul><p></p><ul></ul><p></p><h4 style=\"font-family: Poppins, sans-serif; color: rgb(34, 34, 34);\"><span style=\"font-family: Helvetica;\">CONDICIONES DE PAGO</span></h4><ul><li style=\"font-family: Poppins, sans-serif; color: rgb(34, 34, 34);\"><span style=\"font-family: -apple-system;\">Puedes pagar mediante deposito o transferencia bancaria solo adjuntando el comprobante de pago.</span></li><li><span style=\"color: rgb(34, 34, 34); font-family: -apple-system;\">Puedes comprar a meses con cualquier tarjeta soportada por </span><font color=\"#222222\" face=\"Helvetica\"><span style=\"font-family: -apple-system;\">PayPal (para lo cual requieres una cuenta de PayPal).</span></font></li><li><font color=\"#222222\" face=\"Helvetica\"><span style=\"font-family: -apple-system;\">Para compras en pagos se require que adjuntes una copia de tu credencial por seguridad, cuyos datos deberán coincidir con los suministrados en PayPal.</span></font></li></ul><h4 style=\"font-family: Poppins, sans-serif; color: rgb(34, 34, 34);\"><span style=\"font-family: Helvetica;\"><br></span></h4><h4 style=\"font-family: Poppins, sans-serif; color: rgb(34, 34, 34);\"><span style=\"font-family: Helvetica;\">CONDICIONES DE ENVIO</span></h4><ul><li style=\"font-family: Poppins, sans-serif; color: rgb(34, 34, 34);\"><span style=\"font-size: 1rem; font-family: Verdana;\">Los envíos pueden tardar en procesarse hasta 72 </span><span style=\"font-size: 1rem; font-family: Verdana;\">horas</span><span style=\"font-size: 1rem; font-family: Verdana;\"> después de la confirmación de su pago.</span></li><li><font color=\"#222222\" face=\"Helvetica\"><span style=\"font-family: -apple-system;\">Se le suministrara un numero de guía para rastrear su paquete por medio del correo o el numero que suministro. </span></font></li><li><span style=\"font-size: 1rem; font-family: -apple-system;\">Las entregas se realizaran únicamente en los dias hábiles a través de la empresa de paquetería, por lo que no se realizaran en dias festivos en los que oficialmente no haya servicio de bancos en México.</span></li><li><span style=\"font-family: -apple-system;\">Los envíos están asegurados por lo que si tu envío se desvía o no te es entregado, deberas comunicarlo de inmediato para poder hacer efectivo el seguro.</span></li><li><span style=\"font-size: 1rem; font-family: -apple-system;\">Micel Store no sera directamente responsable en caso de que el plazo de entrega </span><span style=\"font-family: -apple-system;\">hábiles</span><span style=\"font-size: 1rem; font-family: -apple-system;\"> no sea cumplido cuando el incumplimiento en el plazo de entrega se origine por circunstancias ajenas a la empresa de paquetería </span><span style=\"font-size: 1rem; font-family: -apple-system;\">( en caso de que dicha </span><span style=\"font-family: -apple-system;\">paquetería</span><span style=\"font-size: 1rem; font-family: -apple-system;\"> lleve el pedido al domicilio y el cliente no se encuentre en dicho lugar, el cliente </span><span style=\"font-family: -apple-system;\">tendrá</span><span style=\"font-size: 1rem; font-family: -apple-system;\"> que acudir a la </span><span style=\"font-family: -apple-system;\">paquetería</span><span style=\"font-size: 1rem; font-family: -apple-system;\"> para recibir el producto).</span></li></ul><h4 style=\"font-family: Poppins, sans-serif; color: rgb(34, 34, 34);\"><span style=\"font-family: Helvetica;\"><br></span></h4><h4 style=\"font-family: Poppins, sans-serif; color: rgb(34, 34, 34);\"><span style=\"font-family: Helvetica;\">CONDICIONES DE GARANTÍA</span></h4><ul><li><span style=\"font-family: -apple-system;\">La garantía es aplicable solamente durante el periodo establecido al momento de realizar su compra (30 dias después de haber recibido su producto, más la garantía directa con el fabricante).</span></li><li><span style=\"font-family: -apple-system;\">La garantía solo aplica defectos de fabrica y en ningún momento Micel Store se hace responsable de datos sufridos por culpa del usuario (incluyendo daños por usos contrarios a los indicados en los manuales del producto, daños por caídas o por sumergir el dispositivo en líquidos, etc..).</span></li><li><span style=\"font-family: -apple-system;\">El usuario deberá cubrir los costos de envío en caso de tenga que regresar su dispositivo por cuestiones de garantía y Micel Store cubrirá los costos del nuevo dispositivo que se le suministrara de reemplazo.</span></li></ul><p>Al utilizar nuestro sitio web y realizar compras en el se entiende que usted acepta y ha leído nuestros términos y condiciones.</p><p><br></p><h4 style=\"color: rgb(34, 34, 34);\"><font face=\"Helvetica\">Aviso de privacidad</font></h4><ul><li>Micel Store no almacena datos bancarios ni cuentas de facebook de nuestros clientes, estos datos son almacenados por terceros a quienes el cliente habra dado autorización previa para utilizar (PayPal y facebook).</li><li>Micel Store se compromete a mantener privados sus datos personales y a utilizarlos solo para los fines mencionados, en caso de que la seguridad de nuestro sitio web fuera vulnerado le informaríamos de inmediato para que usted tome las medidas pertinentes.</li><li>Verifique el certificado de nuestro sitio web para asegurarse que esta utilizando un sitio real y no uno apócrifo.</li><li>Micel Store no colecta datos de navegación de sus clientes, aunque facebook y PayPal podrían hacerlo. </li></ul><p><br></p><p><span style=\"caret-color: rgb(34, 34, 34); color: rgb(34, 34, 34); font-family: Helvetica; font-size: 24px;\"><br></span><br></p>                                                                                                                                                                                                      ', '19.07');

