(5, '¿Los equipos son Originales?', 'Si, no vendemos equipos clones, solo equipos originales.'),
(6, '¿Por qué tan baratos?', 'Dependiendo de donde vivas, los precios te parecerán mas o menos baratos, estos equipos son traídos de la frontera por lo que están libres de de IVA y eso los hace mas accesibles, tratamos de ofrecer equipos a el mejor precio.'),
(7, '¿Tienen garantía?', 'Si, aunque limitada. 30 dias con nosotros en equipos SemiNuevos y Nuevos, mas 1 año directo con el proveedor en el caso de los nuevos.'),
(8, '¿Cuál es el costo del envío?', 'Por porción de apertura el envío es gratis :D'),
(9, '¿Es seguro el envio?', 'Utilizamos DHL por ser por el momento la mejor empresa de logística para nosotros, los envíos van asegurados, por lo tanto en la rara situación que algo ocurriera a tu equipo, podemos volver a enviarte otro.'),
(10, '¿Aceptan tarjetas de credito ?', 'Si pero solo por PayPal (necesitas tener una cuenta) tus datos deben ser verificados antes de aprobar la compra.'),
(11, '¿Hacen entregas personales?', 'Si :D, pero como vamos comenzando solo en Pachuca Hidalgo.');

